Deserialize a value by passing a Visitor to the given Deserializer. The Deserializer will call one of the Visitor methods depending on the input data, which is known as "driving" the Visitor. # use std::fmt;
#
# use serde::de::{Deserialize, Deserializer, Visitor};
#
# #[allow(non_camel_case_types)]
# struct i32;
# struct I32Visitor;
#
# impl<'de> Visitor<'de> for I32Visitor {
# type Value = i32;
#
# fn expecting(&self, _: &mut fmt::Formatter) -> fmt::Result {
# unimplemented!()
# }
# }
#
impl<'de> Deserialize<'de> for i32 { fn deserialize<D>(deserializer: D) -> Result<i32, D::Error> where D: Deserializer<'de>, { deserializer.deserialize_i32(I32Visitor) }
}
#
# fn main() {} Note that a Deserializer will not necessarily follow the type hint, so the call to deserialize_i32 does not necessarily mean the Deserializer will call I32Visitor::visit_i32. For example JSON treats all signed integer types alike. The JSON Deserializer will call visit_i64 for any signed integer and visit_u64 for any unsigned integer, even if hinted a different type.

