} // In order to handle commas correctly when deserializing a JSON array or map,
// we need to track whether we are on the first element or past the first
// element.
struct CommaSeparated<'a, 'de: 'a> { de: &'a mut Deserializer<'de>, first: bool,
} impl<'a, 'de> CommaSeparated<'a, 'de> { fn new(de: &'a mut Deserializer<'de>) -> Self { CommaSeparated { de, first: true, } }
} // `SeqAccess` is provided to the `Visitor` to give it the ability to iterate
// through elements of the sequence.
impl<'de, 'a> SeqAccess<'de> for CommaSeparated<'a, 'de> { type Error = Error; fn next_element_seed<T>(&mut self, seed: T) -> Result<Option<T::Value>> where T: DeserializeSeed<'de>, { // Check if there are no more elements. if self.de.peek_char()? == ']' { return Ok(None); } // Comma is required before every element except the first. if !self.first && self.de.next_char()? != ',' { return Err(Error::ExpectedArrayComma); } self.first = false; // Deserialize an array element. seed.deserialize(&mut *self.de).map(Some) }
} // `MapAccess` is provided to the `Visitor` to give it the ability to iterate
// through entries of the map.
impl<'de, 'a> MapAccess<'de> for CommaSeparated<'a, 'de> { type Error = Error; fn next_key_seed<K>(&mut self, seed: K) -> Result<Option<K::Value>> where K: DeserializeSeed<'de>, { // Check if there are no more entries. if self.de.peek_char()? == '}' { return Ok(None); } // Comma is required before every entry except the first. if !self.first && self.de.next_char()? != ',' { return Err(Error::ExpectedMapComma); } self.first = false; // Deserialize a map key. seed.deserialize(&mut *self.de).map(Some) } fn next_value_seed<V>(&mut self, seed: V) -> Result<V::Value> where V: DeserializeSeed<'de>, { // It doesn't make a difference whether the colon is parsed at the end // of `next_key_seed` or at the beginning of `next_value_seed`. In this // case the code is a bit simpler having it here. if self.de.next_char()? != ':' { return Err(Error::ExpectedMapColon); } // Deserialize a map value. seed.deserialize(&mut *self.de) }
} struct Enum<'a, 'de: 'a> { de: &'a mut Deserializer<'de>,
} impl<'a, 'de> Enum<'a, 'de> { fn new(de: &'a mut Deserializer<'de>) -> Self { Enum { de } }
